import React from "react";

const CityCard = ({ data }) => {
  return (
    <div className="mt-6 p-6 bg-white dark:bg-gray-800 rounded shadow-md">
      <h2 className="text-2xl font-semibold">{data.title}</h2>
      <p className="mt-2">{data.extract}</p>
      {data.thumbnail?.source && (
        <img src={data.thumbnail.source} alt={data.title} className="mt-4 rounded" />
      )}
    </div>
  );
};

export default CityCard;
